Fort Davis Indians
April 12 at 7:48 PM Â·

Dirks-Anderson Elementary Parents/guardians can pick up new assignments and drop off completed assignments at the elementary campus tomorrow (Monday, April 13).

Grade 3 will NOT have to drop off or pick up any assignments.

To avoid large crowds, we have set the following schedule for pick up:

PreK- 9:00 a.m.;
Kindergarten - 9:30 a.m.;
1st Grade - 10 a.m.;
2nd Grade - 10:30 a.m.;
4th Grade - 11:00 a.m.
5th Grade - 11:30 a.m.

Online instruction will continue for all FDISD students Thank you for supporting your students and the district as we go through this difficult time.

Please call the school if you need assistance. Dirks-Anderson - 432-426-4454.

